import { all, put, call, takeEvery } from 'redux-saga/effects';

import { actionTypes, getActiveMainSuccess, getInactiveMainSuccess } from './action';

import ExaminationCalendarRepository from '../../repositories/ExaminationCalendarRepository';

function* getAllExaminationCalendaSaga({ payload }) {
    console.log(payload,"1")
    try {
        const data = yield call(ExaminationCalendarRepository.getActiveMain, payload);
        yield put(getActiveMainSuccess(data));
    } catch (err) {
        yield put(getActiveMainSuccess(null));
    }
}

function* getInactiveExaminationCalendaSaga({ payload }) {
    console.log(payload,"1")
    try {
        const data = yield call(ExaminationCalendarRepository.getInactiveMain, payload);
        yield put(getInactiveMainSuccess(data));
    } catch (err) {
        yield put(getInactiveMainSuccess(null));
    }
}

export default function* rootSaga() {
    yield all([takeEvery(actionTypes.GET_ALL_EXAMINATIONCALENDAR_REQUEST, getAllExaminationCalendaSaga)]);
    yield all([takeEvery(actionTypes.GET_INACTIVE_EXAMINATIONCALENDAR_REQUEST, getInactiveExaminationCalendaSaga)]);
}
